import React from "react";
import "./Picker.css";
import ButtonBack from '../buttons/ButtonBack'


function Picker(props) {

    return (
      <div>
        <div id="picker" className={props}>
        </div>
        PICKER
        {console.log(props)}
        </div>
    );


}

export default Picker;
